import React from "react";

const Stocks = () => {
  return (
    <div>
      <h1>Stocks </h1>
      Amont : <input type="Number" placeholder="Amt in nos"></input>
      <br></br>
      Quantity : <input type="Number" placeholder="Amt in nos"></input>
    </div>
  );
};

export default Stocks;
